import React from 'react'
import Card from './Card'

// We  destructure a users variable from 
// the users to object
import { users } from '../Users';

function CardList() {
    // populate the card component dynamically from User.js
    const aCardComponent = users.map((user) => {
        return (
            <div>
                <Card key={user.id}
                    name={user.name}
                    email={user.email}/>
            </div>
        )
    })

    // Return a card component with the right information
    return (<div>{aCardComponent}</div>);
}

export default CardList;
